import React from 'react'
import classes from './MyModalNavigation.module.css'

const MyModalNavigation = ({visible, setVisible}) => {
  const rootClasses = [classes.myModalNavigation]

    if (visible) {
        rootClasses.push(classes.active)
    }

    return (
        <div className={rootClasses.join(' ')} onClick={() => setVisible(false)} >
            <div className={classes.myModalNavigationContent} onClick={(e) => e.stopPropagation()} >
                Lorem ipsum dolor sit amet consectetur adipisicing elit. Rerum eius ipsa sapiente consectetur eaque perspiciatis qui, vel porro natus voluptatem eveniet totam esse molestias dolores quasi numquam. Enim, rerum consequuntur?
            </div>
        </div>
    )
}

export default MyModalNavigation;
